import React from 'react'
import s from './common-corners.module.scss'

function CommonCorners () {

  return (
    <>
      <span className={s.corn1}></span>
      <span className={s.corn2}></span>
      <span className={s.corn3}></span>
      <span className={s.corn4}></span>
    </>
  )
}

export default CommonCorners
